INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256221282559', 'Assortiment de petits fours apéritifs', 'Mini feuilleté garni d\'une préparation à base de fromage roquefort fondu 23% : eau, farine de BLE, fromage roquefort fondu 19%* (ROQUEFORT 9.5%*, eau, amidon transformé de pomme de terre, sel de fonte : citrates de sodium), margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiants : mono- et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), préparation déshydratée pour sauce type béchamel (LACTOSERUM, amidon transformé de pomme de terre, matière grasse végétale de colza, amidon de BLE, poudre de LAIT écrémé, sirop de glucose, épaississant : alginate de sodium, protéines de LAIT, arômes naturels, épices), raisins secs (raisins, huile de tournesol), graines de pavot, sel, persil, OEUF entier en poudre.Mini feuilleté garni de saucisse et d\'une préparation à base de moutarde 23% : saucisse de Strasbourg 40%* (viande et gras de porc, eau, sel, protéines de LAIT, dextrose, stabilisant : diphosphates, arômes naturels, épices, antioxydant : acide ascorbique, colorants : carmins et extrait de paprika), eau, farine de BLE, margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiants : mono- et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), préparation déshydraté pour sauce (LACTOSERUM, amidon modifié de pomme de terre, LAIT entier en poudre, sel, épaississant : gomme xanthane, poivre, muscade), moutarde 2%* (eau, graine de MOUTARDE, vinaigre d\'alcool, sel), graine de pavot, sel, OEUF entier en poudre.Mini feuilleté garni d\'une préparation à base de champignons 21% : farine de BLE, champignons 21%, eau, margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiants : mono- et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), crème (CREME, stabilisant : carraghénanes), échalote, amidon transformé de BLE, sel, chapelure (farine de BLE, eau, sel, levure), BEURRE, OEUF entier en poudre, ail, poivre noir.Mini feuilleté garni d\'une préparation à base de Noix de Saint-Jacqus* 17% : farine de BLE, eau, margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiants : mono- et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), noix de Saint-Jacques** 6%* [Zygochlamys patagonica, origine Argentine (J) ou USA (S) ou Uruguay (U), Chlamys opercularis, origine Royaume Uni (R), Iles Féroé (F), Argopecten Purpuratus, origine Pérou (P) ou Chili (C), Argopecten circularis, origine Mexique (M)], préparation déshydraté pour sauce (LACTOSERUM, amidon modifié de pomme de terre, LAIT entier en poudre, sel, épaississant : gomme xanthane, poivre, muscade), sel, persil, arôme naturel (dont LAIT, POISSONS, CRUSTACES et MOLLUSQUES), OEUF entier en poudre, poivre noir.Mini croque monsieur au jambon cuit choix 16% : eau, pain de mie 28%* [farine de blé (farine de BLE, gluten de BLE, farine de BLE malté, agent de traitement de la farine : acide ascorbique), eau, LAIT entier en poudre, levure, huile d\'olive vierge extra, sel, émulsifiants : mono- et diglycérides d\'acides gras, esters mono- et diacétyl-tartriques des mono- et diglycérides d\'acides gras, agent de traitement de la farine : acide ascorbique], jambon cuit choix 20%* (jambon de porc, eau, sel, arômes naturels, bouillon de légumes, ferments), fromage EMMENTAL râpé 11%*, BEURRE, farine de BLE, LAIT entier en poudre, sel, poivre noir.*Les pourcentages sont exprimés sur chaque variété de petits fours.** L¿espèce et l\'origine de la noix de Saint-Jacques sont indiquées par la 1ère lettre dans le numéro de lot. Traces éventuelles soja, fruits à coque, céleri, graines de sésame, sulfites.', '16.5', '8.3', '24.8', '3.3', '1.8', '6', '1.2', '0.47244094488189', '', '0');

