INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256221828580', 'Bûchettes Glacées, saveurs vanille-crème brûlée, framboise, chocolat', '2 Bûchettes sorbet à la framboise et crème glacée à la vanille avec en décor des micro-copeaux de chocolat noir.  Sorbet à la framboise 56% : eau, purée de framboise 35%*, sucre, jus concentré de sureau, jus concentré de citron, gélifiants : gomme tara — pectines - gomme xanthane, colorant: rouge de betterave, protéines de pois hydrolysées, arôme naturel. *% exprimé sur le sorbet à la framboise. Crème glacée à la vanille 43,1% : lait écrémé réhydraté, eau, sucre, crème, poudre de lactosérum, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube - gomme guar, arôme naturel de vanille. Micro—copeaux de chocolat noir 0,9% : pâte de cacao, sucre, beurre de cacao, beurre concentré, émulsifiant : lécithine de soja, extrait de vanille.  2 Bûchettes crèmes glacées au chocolat noir et à la vanille avec en décor des micro-copeaux de chocolat noir. Crème glacée au chocolat noir 54,7% : lait écrémé réhydraté, eau, crème, sucre, chocolat noir 6%* (pâte de cacao, sucre, cacao maigre en poudre, émulsifiant : lécithine de soja, arôme naturel de vanille), poudre de cacao, poudre de lactosérum, pâte de cacao, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube — gomme guar, poudre de cacao maigre.*(% exprimé sur la crème glacée au chocolat noir) Crème glacée à la vanille 44,4% : lait écrémé réhydraté, eau, sucre, crème, poudre de lactosérum, émulsifiant: mono— et diglycérides d’acides gras, gélifiants : farine de graines de caroube — gomme guar, arôme naturel de vanille. Micro—copeaux de chocolat noir 0,9%*: pâte de cacao, sucre, beurre de cacao, beurre concentré, émulsifiant : lécithine de soja, extrait de vanille. 2 Bûchettes crèmes glacées saveur crème brûlée et à la vanille avec en décor des micro copeaux de chocolat noir. Crème glacée saveur crème brûlée 54.7% : eau, sirop de glucose—fructose, crème, lait écrémé réhydraté, sucre, poudre de lactosérum, arôme naturel, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube - gomme guar, colorants : rocou — curcumine. Crèm glacée à la vanille 44,4% : lait écrémé réhydraté, eau, sucre, crème, poudre de lactosérum, émulsifiant : mono- et diglycérides d’acides gras, gélifiants : farine de graines de caroube — gomme guar, arôme naturel de vanille.   Micro-copeaux de chocolat noir 0,9% : pâte de cacao, sucre, beurre de cacao, beurre concentré, émulsifiant : lécithine de soja, extrait de vanille.  ', '5.7', '3.8', '23.9', '22.3', '0.2', '1.9', '0.130048', '0.0512', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256221829792', 'Bûche glacée, Saveur crème brulée, caramel, vanille', '  Crème glacée au caramel 37% : eau, crème, lait écrémé, réhydraté, sucre, caramel aromatique, 11%* (sucre, eau, acidifiant : acide citrique), lactose et protéine de lait, sirop de glucose, colorant : caramel ordinaire, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graine de caroube - gomme guar, arôme naturel. * Pourcentage exprimé sur la crème glacée au caramel. Crème glacée saveur crème brûlée 33.2% : eau, lait écrémé réhydraté, crème, sirop de glucose-fructose, sucre, lactose et protéines de lait, sirop de glucose, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, arôme, arôme naturel, colorants : rocou et curcumine. * Pourcentage exprimé sur la crème glacée saveur crème brûlée. Crème glacée à la vanille avec morceaux de noisettes caramélisées 27.9% : eau, lait écrémé réhydraté, crème, sirop de glucose-fructose, sucre, morceaux de noisettes caramélisées 8.2%* (noisettes 96%, sucre, sirop de glucose, miel), lactose et protéines de lait, sirop de glucose, arôme naturel de vanille, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, colorants : rocou et curcumine,. * Pourcentages exprimés sur la crème glacée à la vanille avec des morceau de noisettes caramélisées. Amandes effilées grillées 0.8%  Brisures de nougat noir 0.6% : amandes 34%*, sirop de glucose, sucre, huile végétale de tournesol, colorant : caramel ordinaire, agent d\'enrobage : cire de carnauba. * Pourcentage exprimé sur les brisures de nougat noir. Plaquette de chocolat 0.5% : pâte de cacao, sucre, beurre de cacao, arôme naturel de vanille, colorants : carbonate de calcium - oxyde et hydroxyde de fer.', '10.2', '5.6', '26.1', '24', '0.5', '2.3', '0.100076', '0.0394', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256221829969', 'Bûche glacée Passion, Coco, Framboise', 'Crème glacée à la noix de coco 35% : eau, lait écrémé réhydraté, crème, sucre, sirop de glucose-fructose, noix de coco en poudre 7.7%* (lait de noix de coco en poudre 89.5%, caséinate de sodium), lactose et protéines de lait, sirop de glucose, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, arôme naturel. * Pourcentages exprimés sur la crème glacée à la noix de coco. Glace au fruit de la passion 34.4% : jus de fruit de la passion à base de concentré28%*; lait écrémé réhydraté, sucre, crème, sirop de glucose-fructose, eau, sirop de glucose, lactose et protéines de lait,  arôme naturel de fruit de la passion, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube _ gomme guar, colorant : caroténoïdes. * Pourcentages exprimés sur la glace au fruit de la passion. Sorbet à la framboise avec des inclusions de morceaux de framboise 29.9% : purée de framboise  36.8%*, eau, sucre, sirop de glucose-fructose, préparation de morceaux de framboise 8%* (morceaux de framboise 55%, sucre, sirop de glucose-fructose, eau, amidon modifié de maïs, arôme naturel, jus concentré de fruits rouges, gélifiants : gomme de graines xanthane carraghénanes, correcteur d\'acidité : citrate de potassium, sirop de glucose, arômes naturels de framboise, jus concentré de sureau, gélifiants : pectines - gomme - tara - gomme xanthane, correcteur d\'acidité : acide citrique, colorant : rouge de betterave, protéines de pois hydrolysés. * Pourcentages exprimés  sur le sorbet  à la framboise avec des inclusions d\'une préparation de morceaux de framboise. Pépites à la framboise 0.8% : purée de framboise 32.8%*, sucre, purée de pomme, dextrose, fibre d\'ananas, colorant : anthocianes, gélifiant : alginate de sodium, stabilisant : phosphates de calcium, arôme, correcteur d\'acidité : acide citrique. * Pourcentages exprimés sur les pépites à la framboise. Plaquette de chocolat 0.5%, pâte de cacao, sucre, beurre de cacao, arôme naturel de vanille, colorants : carbonate de calcium - oxyde et hydroxyde de fer. Morceaux de meringue enrobée de beurre de cacao 0.4% : meringue 80%* (sucre, blanc d\'oeuf, amidon de blé,), beurre de cacao 16%*, sucre. * Pourcentage exprimés sur les morceaux de merringue enrobée de beurre de cacao.  ', '5.8', '4.1', '28.3', '24.9', '0.6', '1.5', '0.100076', '0.0394', '', '0');

